import logo from './logo.svg';
import './App.css';
import Index from './pages/index/Index';

const App = () => {


    let route = (
      <Switch>
        <Route path="/index" component={Index} />
        <Route path="/espacemembre" component={Espacemembre} />
        <Route path="/registration" component={Registration} />
        <Route path="/forget_password" component={MotDePasseOublier} />
        <Route path="/reinitialize/password/:id" exact component={PasswordChange} />
        <Route path="/reinitialisermotdepasse" component={Reinitialisermotdepasse} />
        <Route path="/validate/account/:id" exact component={VerificationMail} />
        <Redirect to='/login' />
      </Switch>
    )
    return (
      <div>
        {route}
      </div>
  );
}

export default App;
